tables.table_schema:
CREATE TABLE market_trends (
  trend_id INT PRIMARY KEY,
  trend_date DATE,
  trend_description VARCHAR(255),
  impact_on_rates DECIMAL(5, 2)
);

CREATE TABLE market_trends (
    id INT PRIMARY KEY,
    trend_name varchar(255),
    trend_description TEXT
);

CREATE TABLE analysis_data (
    id INT PRIMARY KEY,
    trend_id INT,
    rate DECIMAL(10, 2),
    analysis_date DATE
);

CREATE TABLE adjustments (
    id INT PRIMARY KEY,
    data_id INT,
    adjustment DECIMAL(10, 2),
    adjustment_date DATE
);
